import './App.css';
import Login from './components/Login'
import {Router, Route} from 'react-router-dom';
function App() {


  return (
    <div className="App">
      <Routes>
        <Route exact path="/" component={<Login />}></Route>
      </Routes>
    </div>
  );
}

export default App;
